widget.on('ready', function(){
  let desc = widget.desc;
  let $wrapper = $(`widget[widgetid='${widget.oid}']`);
  var $container = $wrapper.find('.widget-desc');
  if ($container.length == 0){
	$("<div class='widget-desc' style='margin: 10px;'></div>").insertAfter($wrapper.find('widget-header'));
	$container = $wrapper.find('.widget-desc');
	$container.html(`<div class='narration-wrapper resizable loaded' style='padding-bottom: 10px;'><div class='resize-holder ui-resizable text-holder narration-text'>${desc}</div><div class='ui-resizable-handle ui-resizable-s'></div></div>`);
    $wrapper.height(parseInt($wrapper.height())+60);
	$wrapper.find('.dataTables_scroll,.sisense-pivot__multi-grid').css("height","calc(100% - 40px)");
  }
});

